import {
  IonBackButton,
  IonButtons,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import React from "react";
import Card from "../../components/Card/Card";

const Agents: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton />
          </IonButtons>
          <IonTitle>Agents</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <Card id="agent" title="Jonathan Mthembu" subtitle="Complex" />
      </IonContent>
    </IonPage>
  );
};

export default Agents;
